function choseProduct(myArray) {
  var i = myArray.length,
    j,
    temp;
  if (i === 0) return !1;
  while (--i) {
    j = Math.floor(Math.random() * (i + 1));
    temp = myArray[i];
    myArray[i] = myArray[j];
    myArray[j] = temp;
  }
}
