function pfFbLogin(response) {
  $.ajax({
    type: "POST",
    url: url_ajax,
    data: {
      firstname: response.first_name,
      lastname: response.last_name,
      email: response.email,
      id: response.id,
      gender: response.gender,
      action1: loginFacebook,
    },
    success: function (data) {
      if (rb_facebook.login_redirect == "no_redirect") window.location.reload();
      if (rb_facebook.login_redirect == "authentication_page")
        window.location.href = rb_facebook.login_destination;
    },
  });
}
function fb_login() {
  FB.login(function (response) {
    if (response.authResponse) {
      FB.api(
        "/me",
        { fields: "id,first_name,last_name,email,gender" },
        function (response) {
          pfFbLogin(response);
        }
      );
    }
  });
}
function checkLoginState() {
  FB.getLoginStatus(function (response) {
    statusChangeCallback(response);
  });
}
function statusChangeCallback(response) {
  if (response.status === "connected") {
    fb_login();
  }
}
