$(document).ready(function () {
  $(".select-filter").select2();
  $(".select-filter").change(function () {
    var level = $(this).data("level");
    $(".rb-filter-alert").hide();
    if (level <= 3) {
      if ($(this).val() != 0) {
        $(".rb-ajax-filter").show();
        var str_id = "";
        var link = "";
        if (level == 1) {
          str_id = $(this).val();
        }
        if (level == 2) {
          str_id = $("#rb_class").val() + "," + $(this).val();
        }
        if (level == 3) {
          str_id =
            $("#rb_class").val() +
            "," +
            $("#rb_make").val() +
            "," +
            $(this).val();
        }
        ajaxFilterValue(level, str_id);
      } else {
        if (level == 1) {
          $(".item-search").remove();
          $("#rb_make").attr("disabled", !0);
          $("#rb_model").attr("disabled", !0);
          $("#rb_year").attr("disabled", !0);
        }
        if (level == 2) {
          $("#rb_model .item-search").remove();
          $("#rb_year .item-search").remove();
          $("#rb_model").attr("disabled", !0);
          $("#rb_year").attr("disabled", !0);
        }
        if (level == 3) {
          $("#rb_year .item-search").remove();
          $("#rb_year").attr("disabled", !0);
        }
      }
    }
  });
  resetSearch();
  redrectPageFilter();
});
function ajaxFilterValue(level, str_id) {
  $.ajax({
    type: "POST",
    url: rb_ajax_url,
    headers: { "cache-control": "no-cache" },
    async: !0,
    cache: !1,
    dataType: "json",
    data: {
      ajax: 1,
      token: token,
      level: level,
      str_id: str_id,
      action: "searchValue",
    },
    success: function (data) {
      $(".rb-form-reset").show();
      $(".rb-ajax-filter").hide();
      if (level == 1) {
        if (data.success == 1) {
          $("#rb_make").append(data.message);
          $("#rb_make").attr("disabled", !1);
        } else {
          $("#rb_make").attr("disabled", !0);
          $("#rb_model").attr("disabled", !0);
          $("#rb_year").attr("disabled", !0);
        }
      }
      if (level == 2) {
        if (data.success == 1) {
          $("#rb_model").append(data.message);
          $("#rb_model").attr("disabled", !1);
        } else {
          $("#rb_model").attr("disabled", !0);
          $("#rb_year").attr("disabled", !0);
        }
      }
      if (level == 3) {
        if (data.success == 1) {
          $("#rb_year").append(data.message);
          $("#rb_year").attr("disabled", !1);
        } else {
          $("#rb_year").attr("disabled", !0);
        }
      }
    },
  });
}
function redrectPageFilter() {
  var id_class = 0;
  var id_make = 0;
  var id_model = 0;
  var id_year = 0;
  $(".rb-filter").click(function () {
    if ($("#rb_class").length > 0 && $("#rb_class").val() == 0) {
      $(".rb-field").html('"' + $("#rb_class option:selected").html() + '"');
      $(".rb-filter-alert").show();
      return !1;
    } else {
      id_class = $("#rb_class").val();
    }
    if ($("#rb_make").length > 0 && $("#rb_make").val() == 0) {
      $(".rb-field").html('"' + $("#rb_make option:selected").html() + '"');
      $(".rb-filter-alert").show();
      return !1;
    } else {
      id_make = $("#rb_make").val();
    }
    if ($("#rb_model").length > 0 && $("#rb_model").val() == 0) {
      $(".rb-field").html('"' + $("#rb_model option:selected").html() + '"');
      $(".rb-filter-alert").show();
      return !1;
    } else {
      id_model = $("#rb_model").val();
    }
    if ($("#rb_year").length > 0 && $("#rb_year").val() == 0) {
      $(".rb-field").html('"' + $("#rb_year option:selected").html() + '"');
      $(".rb-filter-alert").show();
      return !1;
    } else {
      id_year = $("#rb_year").val();
    }
    $.ajax({
      type: "POST",
      url: rb_ajax_url,
      headers: { "cache-control": "no-cache" },
      async: !0,
      cache: !1,
      dataType: "json",
      data: {
        ajax: 1,
        token: token,
        id_class: id_class,
        id_make: id_make,
        id_model: id_model,
        id_year: id_year,
        action: "searchPageFilter",
      },
      success: function (data) {
        if (data.success == 1) {
          window.location.href = data.message;
        }
      },
    });
  });
}
function resetSearch() {
  $(".rb-reset").click(function (e) {
    e.preventDefault();
    $("#rb_class option:selected").removeAttr("selected");
    $(".class-default").attr("selected", "selected");
    $("#select2-rb_class-container").html($(".class-default").html());
    $(".item-search").remove();
    $("#rb_make").attr("disabled", !0);
    $("#rb_model").attr("disabled", !0);
    $("#rb_year").attr("disabled", !0);
    $(".rb-form-reset").hide();
  });
}
